// Imports
import React, { Component } from "react";
import Bar from "../Bar/Bar";
import GridSize from "../Grid/GridSize/GridSize";

class App extends Component {
  render() {
    return (
      <div>
        <Bar rows={10} cols={10} />
        <div id="main_container">
          <GridSize />
          <div id="grid_container">
            <table>
              <tbody id="grid"></tbody>
            </table>
          </div>
        </div>
      </div>
    );
  }
}
export default App;
